import 'moment/locale/fr'
import React, { useState } from 'react'
import AppBar from '@mui/material/AppBar'
import Box from '@mui/material/Box'
import Toolbar from '@mui/material/Toolbar'
import moment from 'moment'
import styled from 'styled-components'
import ListItem from '@mui/material/ListItem'
import { useHistory } from 'react-router-dom'
import { MenuItem, Select } from '@mui/material'

const SToolbar = styled(Toolbar)`
  display: flex;
  justify-content: space-between;
`
const ListContainer = styled.div`
  display: flex;
  width: 35vw;
  justify-content: space-between;
  padding: 0;
`
const Header = styled.div`
  display: flex;
  padding: 0 1em;
`
const Footer = styled.div`
  padding: 0 1em;
`

const Navbar = ({setCurrentPage, currentPage}) => {
  const history = useHistory()
  const date = moment().locale("fr").format('LL');

  const handleChange = (event) => {
    debugger
    setCurrentPage(event.target.value)
    history.push(event.target.value)
  }

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <SToolbar>
          <Header>
            <img src="https://www.cipecma.com/templates/cipecma/images/logo.png" alt="Logo Cipecma" width="100px" height="55px"/>
            <ListContainer>
              <Select
                labelId="demo-simple-select-standard-label"
                id="demo-simple-select-standard"
                value={currentPage ?? "Page"}
                onChange={handleChange}
                label="label"
              >
                <MenuItem value={"/home"}>Accueil</MenuItem>
                <MenuItem value={"/profil"}>Profil</MenuItem>
                <MenuItem value={"/numerisk_and_me"}>L'Entreprise et Moi</MenuItem>
                <MenuItem value={"/professionals_situations"}>Situations Professionelles</MenuItem>
                <MenuItem value={"/annexes"}>Annexes</MenuItem>
              </Select>
            </ListContainer>
          </Header>
          <Footer>
            {date}
          </Footer>
        </SToolbar>
      </AppBar>
    </Box>
  )
}

export default Navbar
